package 滑动窗口;

import tools.Asserts;
import tools.Times;

import java.util.HashMap;
import java.util.Map;

public class _076_最小覆盖子串 {
    /**
     * 寻找字符串 s 中包含字符串 t 所有字符的最小窗口
     * T = O(n)
     *
     * @param s 源字符串
     * @param t 目标字符串，需要在源字符串中寻找包含它的最小窗口
     * @return 返回最小窗口字符串，如果不存在则返回空字符串
     */
    public String minWindow(String s, String t) {
        char[] sArray = s.toCharArray();
        char[] tArray = t.toCharArray();

        // 存储需要匹配的字符及其数量
        Map<Character, Integer> need = new HashMap<>();
        // 存储当前窗口中各字符的数量
        Map<Character, Integer> window = new HashMap<>();

        // 初始化 need map
        for (char c : tArray) {
            need.put(c, need.getOrDefault(c, 0) + 1);
        }

        // 初始化窗口的左右指针
        Integer left = 0, right = 0;
        // 记录窗口中满足 need 条件的字符个数
        Integer valid = 0;
        // 记录最小覆盖子串的起始索引及长度
        Integer start = 0, len = Integer.MAX_VALUE;
        // 开始滑动窗口遍历
        while (right < sArray.length) {
            // c 是将移入窗口的字符
            char c = sArray[right];
            // 右移窗口
            right++;
            // 进行窗口内数据的一系列更新
            if (need.containsKey(c)) {
                window.put(c, window.getOrDefault(c, 0) + 1);
                if (window.get(c).equals(need.get(c))) {
                    valid++;
                }
            }

            // 判断左侧窗口是否要收缩
            while (valid == need.size()) {
                // 在这里更新最小覆盖子串
                if (right - left < len) {
                    start = left;
                    len = right - left;
                }
                // d 是将移出窗口的字符
                char d = sArray[left];
                // 左移窗口
                left++;
                // 进行窗口内数据的一系列更新
                if (need.containsKey(d)) {
                    if (window.get(d).equals(need.get(d))) {
                        valid--;
                    }
                    window.put(d, window.get(d) - 1);
                }
            }
        }

        // 返回最小覆盖子串
        return len == Integer.MAX_VALUE ? "" : s.substring(start, start + len);
    }

    public String minWindow2(String S, String t) {
        char[] s = S.toCharArray();
        int m = s.length;
        int ansLeft = -1;
        int ansRight = m;
        int[] cntS = new int[128]; // s 子串字母的出现次数
        int[] cntT = new int[128]; // t 中字母的出现次数
        for (char c : t.toCharArray()) {
            cntT[c]++;
        }

        int left = 0;
        for (int right = 0; right < m; right++) { // 移动子串右端点
            cntS[s[right]]++; // 右端点字母移入子串
            while (isCovered(cntS, cntT)) { // 涵盖
                if (right - left < ansRight - ansLeft) { // 找到更短的子串
                    ansLeft = left; // 记录此时的左右端点
                    ansRight = right;
                }
                cntS[s[left]]--; // 左端点字母移出子串
                left++;
            }
        }
        return ansLeft < 0 ? "" : S.substring(ansLeft, ansRight + 1);
    }

    private boolean isCovered(int[] cntS, int[] cntT) {
        for (int i = 'A'; i <= 'Z'; i++) {
            if (cntS[i] < cntT[i]) {
                return false;
            }
        }
        for (int i = 'a'; i <= 'z'; i++) {
            if (cntS[i] < cntT[i]) {
                return false;
            }
        }
        return true;
    }

    public String minWindow3(String S, String t) {
        char[] s = S.toCharArray();
        int m = s.length;
        int ansLeft = -1;
        int ansRight = m;
        int[] cnt = new int[128];
        int less = 0;
        for (char c : t.toCharArray()) {
            if (cnt[c] == 0) {
                less++; // 有 less 种字母的出现次数 < t 中的字母出现次数
            }
            cnt[c]++;
        }

        int left = 0;
        for (int right = 0; right < m; right++) { // 移动子串右端点
            char c = s[right]; // 右端点字母
            cnt[c]--; // 右端点字母移入子串
            if (cnt[c] == 0) {
                // 原来窗口内 c 的出现次数比 t 的少，现在一样多
                less--;
            }
            while (less == 0) { // 涵盖：所有字母的出现次数都是 >=
                if (right - left < ansRight - ansLeft) { // 找到更短的子串
                    ansLeft = left; // 记录此时的左右端点
                    ansRight = right;
                }
                char x = s[left]; // 左端点字母
                if (cnt[x] == 0) {
                    // x 移出窗口之前，检查出现次数，
                    // 如果窗口内 x 的出现次数和 t 一样，
                    // 那么 x 移出窗口后，窗口内 x 的出现次数比 t 的少
                    less++;
                }
                cnt[x]++; // 左端点字母移出子串
                left++;
            }
        }
        return ansLeft < 0 ? "" : S.substring(ansLeft, ansRight + 1);
    }

    public static void main(String[] args) {
        _076_最小覆盖子串 obj = new _076_最小覆盖子串();
        Asserts.test(obj.minWindow("ADOBECODEBANC", "ABC").equals("BANC"));
        Asserts.test(obj.minWindow2("ADOBECODEBANC", "ABC").equals("BANC"));
        Asserts.test(obj.minWindow3("ADOBECODEBANC", "ABC").equals("BANC"));

        String s = "";
        String t = "";

        String res = "";

        Times.test("滑动窗口+哈希", () -> {
            Asserts.test(obj.minWindow(s, t).equals(res));
        });
        Times.test("滑动窗口2", () -> {
            Asserts.test(obj.minWindow2(s, t).equals(res));
        });
        Times.test("滑动窗口3", () -> {
            Asserts.test(obj.minWindow3(s, t).equals(res));
        });
    }
}
